import React from 'react';
import { Routes, Route } from 'react-router-dom';

// Import components
import Navbar from './components/Navbar';
import Dashboard from './pages/Dashboard';
import ProjectCreate from './pages/ProjectCreate';
import ProjectList from './pages/ProjectList';
import DataCollection from './pages/DataCollection';
import Verification from './pages/Verification';
import Marketplace from './pages/Marketplace';
import Reports from './pages/Reports';
import Login from './pages/Login';
import AdminDashboard from './pages/AdminDashboard';

// Layout component for routes that need navbar
const LayoutWithNavbar = ({ children }) => (
  <>
    <Navbar />
    {children}
  </>
);

function App() {
  return (
    <div className="App">
      <Routes>
        {/* Public routes without navbar */}
        <Route path="/login" element={<Login />} />

        {/* User routes with navbar */}
        <Route path="/" element={<LayoutWithNavbar><Dashboard /></LayoutWithNavbar>} />
        <Route path="/dashboard" element={<LayoutWithNavbar><Dashboard /></LayoutWithNavbar>} />
        <Route path="/user/dashboard" element={<LayoutWithNavbar><Dashboard /></LayoutWithNavbar>} />
        <Route path="/projects/create" element={<LayoutWithNavbar><ProjectCreate /></LayoutWithNavbar>} />
        <Route path="/projects" element={<LayoutWithNavbar><ProjectList /></LayoutWithNavbar>} />
        <Route path="/data-collection" element={<LayoutWithNavbar><DataCollection /></LayoutWithNavbar>} />
        <Route path="/verification" element={<LayoutWithNavbar><Verification /></LayoutWithNavbar>} />
        <Route path="/marketplace" element={<LayoutWithNavbar><Marketplace /></LayoutWithNavbar>} />
        <Route path="/reports" element={<LayoutWithNavbar><Reports /></LayoutWithNavbar>} />

        {/* Admin routes */}
        <Route path="/admin/dashboard" element={<AdminDashboard />} />
      </Routes>
    </div>
  );
}

export default App;
